int F(int n, int x, int y) {
  if (n == 0) {
    return x + y;
  } else if (y == 0) {
    return x;
  }

  return F(n - 1, F(n, x, y - 1), F(n, x, y - 1) + y);
}

num sumDigits(var number, var nBase) {
  if (number < 0) number = -number; // convert negative numbers to positive
  if (nBase < 2) nBase = 2;         // nBase can't be less than 2
  num sum = 0;
  while (number > 0) {
    sum += number % nBase;
    number ~/= nBase;
  }
  return sum;
}

